.regex-panel-view {
    position: absolute;
    top: 0%;
    height: 100%;
    width: 100%;
    left: 0%;

    .repeatCommit{
      border-radius: 10px;
      border: 1px solid #d3d3d3;
      box-shadow: 2px 2px 1px #d3d3d3;
      background-color: white;
      position: absolute;
      margin-left: auto;
      margin-right: auto;
      font-size: 12px;
      width: 200px; 
      height: 100px; 
      top: 30%; 
      left: 30%;
      .repeatTitle{
        vertical-align: middle;
        position: absolute;
        top: 1px;
        height: 1.3rem;
        width: 100%;
        text-align: center;
        justify-content: center;
        font-size: 1rem;
        font-weight: bolder;
         color: #808080;
        border-bottom: 1px solid #dfdfdf;
      }
      .el-icon-close{
      position: absolute;
      font-size: 18px;
      font-weight: bolder;
      left: 85%;
      top: 4px;
      color: #808080;
      cursor: pointer;
        &:hover{
          color: steelblue;
        }
      }
      .repeat-text1{
        position:absolute;
        top: 30px;
        left: 60px;
        font-size: 1rem;
        text-align: right;
        font-weight: bolder;
        color: #808080;
      }
      .repeat-input1{
            position: absolute;
            top: 33px;
            left: 100px;
            width: 40px;
            border: 1px solid #bfc2c8 !important;
            border-radius: 2px;
            color: #606266;
      }
      .repeat-text2{
        position:absolute;
        top: 60px;
        left: 56.5px;
        text-align: right;
        font-size: 1rem;
        font-weight: bolder;
        color: #808080;
      }
      .repeat-input2{
            position: absolute;
            top: 63px;
            left: 100px;
            width: 40px;
            border: 1px solid #bfc2c8 !important;
            border-radius: 2px;
            color: #606266;
      }
    }


}
